const ytdl = require("ytdl-core");
const service = require("../service/service");

const jobsCtrl = {
  async createJob(req, res) {
    try {
      const url = req.body.url;
      const isValidUrl = ytdl.validateURL(url);
      if (!isValidUrl) {
        res.status(400);
        return res.send({ error: "invalid URL" });
      }
      const job = await service.createJobInQueue(url);
      return res.send(job);
    } catch (ex) {
      console.log(ex);
      res.status(400);
      return res.send(ex);
    }
  },
  async getJob(req, res) {
    try {
      const fileName = req.params.fileName;
      const file = await service.getJob(fileName);
      res.download(file);
    } catch (ex) {
      console.log(ex);
      res.status(400);
      return res.send(ex);
    }
  },
};

module.exports = {
  createJob: jobsCtrl.createJob,
  getJob: jobsCtrl.getJob,
};

