const dbInterface = require("../interface/db-interface");
const { createVideoQueue } = require("../queue/video");
const path = require("path");
const folderName = "files";

const jobsService = {
  async createJobInQueue(url) {
    try {
      const inputData = {
        url,
        status: "started",
      };
      const job = await dbInterface.createRecord(inputData);
      await createVideoQueue().add({ url, id: job.id });
      return job;
    } catch (ex) {
      console.log(ex);
      throw { error: ex };
    }
  },
  async getJob(fileName) {
    try {
      const filePath = `../${folderName}/${fileName}`;
      const file = path.resolve(__dirname, filePath);
      return file;
    } catch (ex) {
      console.log(ex);
      throw { error: ex };
    }
  },
};

module.exports = {
  createJobInQueue: jobsService.createJobInQueue,
  getJob: jobsService.getJob,
};

