const Queue = require("bull");
const fs = require("fs");
const dbInterface = require("../interface/db-interface");
const ytdl = require("ytdl-core");
const uuidv1 = require("uuidv1");

const createVideoQueue = () => {
  const videoQueue = new Queue("video transcoding", {
    redis: {
      port: process.env.REDIS_PORT,
      host: process.env.REDIS_URL,
    },
  });
  videoQueue.process(async (job, done) => {
    const data = job.data;
    try {
      job.progress(0);
      global.io.emit("progress", { progress: 0, jobId: data.id });
      const uuid = uuidv1();
      const fileLocation = `./files/${uuid}.mp4`;
      await new Promise((resolve) => {
        ytdl(data.url)
          .on("progress", (length, downloaded, totallength) => {
            const progress = (downloaded / totallength) * 100;
            global.io.emit("progress", { progress, jobId: data.id });
            if (progress >= 100) {
              global.io.emit("videoDone", {
                fileLocation: `${uuid}.mp4`,
                jobId: data.id,
              });
              global.io.emit("progress", { progress: 100, jobId: data.id });
            }
          })
          .pipe(fs.createWriteStream(fileLocation))
          .on("finish", () => {
            resolve();
          });
      });
      const condition = {
        _id: data.id,
      };
      const updateData = {
        status: "done",
        fileLocation: `${uuid}.mp4`,
      };
      await dbInterface.updateRecord(condition, updateData);
      done();
    } catch (ex) {
      console.log(ex);
      job.moveToFailed();
    }
  });
  return videoQueue;
};
module.exports = { createVideoQueue };

