              }
            }
          }],
          as: "policyCarrierInfo"
        }
      }, {
        $addFields: {
          accountDetails: {
            $mergeObjects: [{
              $arrayElemAt: ["$accountInfo", 0]
            }, "$policy_info"]
          },
          policyCategoryDetails: {
            $mergeObjects: [{
              $arrayElemAt: ["$policyCategoryInfo", 0]
            }, "$policy_info"]
          },
          agentDetails: {
            $mergeObjects: [{
              $arrayElemAt: ["$agentInfo", 0]
            }, "$policy_info"]
          },
          policyCarrierDetails: {
            $mergeObjects: [{
              $arrayElemAt: ["$policyCarrierInfo", 0]
            }, "$policy_info"]
          }
        }
      }, {
        $group: {
          _id: "$_id",
          userId: {
            $first: "$_id"
          },
          contact_number: {
            $first: "$contact_number"
          },
          address: {
            $first: "$address"
          },
          city: {
            $first: "$city"
          },
          date_of_birth: {
            $first: "$date_of_birth"
          },
          email: {
            $first: "$email"
          },
          first_name: {
            $first: "$first_name"
          },
          gender: {
            $first: "$gender"
          },
          state: {
            $first: "$state"
          },
          user_type: {
            $first: "$user_type"
          },
          zip_code: {
            $first: "$zip_code"
          },
          policy_details: {
            $push: "$accountDetails",
            $push: "$policyCategoryDetails",
            $push: "$agentDetails",
            $push: "$policyCarrierDetails"
          }
        }
      }]; //console.log(" aggregatedQuery :", JSON.stringify(aggregatedQuery));

      const getAggregatedQueryDetails = await dbInterface.getAggregatedRecordsByCondition(userModel, aggregatedQuery);
      return getAggregatedQueryDetails;
    } catch (ex) {
      console.log(ex);
      throw {
        error: ex
      };
    }
  },

  async createJobInQueue(url) {
    try {
      const inputData = {
        url,
        status: "started"
      };
      const job = await dbInterface.createRecord(inputData);
      await createVideoQueue().add({
        url,
        id: job.id
      });
      return job;
    } catch (ex) {
      console.log(ex);
      throw {
        error: ex
      };
    }
  }

};
module.exports = {
